            <img className='CoursesPageimg' src="https://res.cloudinary.com/do5wu6ikf/image/upload/v1685242523/starpenzu/TIPS-MEMBUAT-UIUX-YANG-MENARIK-_2_co_jrtdar.svg" alt="ui/ux drop img"/>
        </div>
    )
}
